import './selector.css';

function Selector(props) {
  return (
    <div className='selectors'>
      <li>
        <ul
          className='button--selected'
          onClick={props.setContent('movie')}
        >
          Movies
        </ul>
        <ul
          className='button'
          onClick={props.setContent('tv')}
        >
          TV
        </ul>
      </li>
   </div>
  )
}

export default Selector;
